//import React from "react";

const Users = (props) => {
  return (
    <ul className="list-group">
      {props.users.map((user) => (
        <li className="list-group-item list-group-item-action" key={user.id}>
          <h5>
            {user.first_name} {user.last_name}
            <p>Email: {user.email}</p>
          </h5>
        </li>
      ))}
    </ul>
  );
};
export default Users;
